        <style>/* H5P Audio Player Responsive Styles */
.h5p-audio {
  width: 100%;
  max-width: 600px;
  margin: 0 auto;
}

.h5p-audio-player {
  position: relative;
  background: #f8f9fa;
  border-radius: 12px;
  padding: 15px;
  box-shadow: 0 2px 8px rgba(0,0,0,0.1);
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif;
}

/* Audio element styling */
.h5p-audio-player audio {
  width: 100%;
  height: 40px;
  outline: none;
}

/* Custom controls for better mobile experience */
.h5p-audio-player::-webkit-media-controls-panel {
  background: transparent;
  border-radius: 8px;
}

.h5p-audio-player::-webkit-media-controls-play-button {
  background-color: #007bff;
  border-radius: 50%;
  margin-right: 10px;
}

.h5p-audio-player::-webkit-media-controls-current-time-display,
.h5p-audio-player::-webkit-media-controls-time-remaining-display {
  font-size: 14px;
  color: #333;
}

/* Mobile-specific styles */
@media screen and (max-width: 768px) {
  .h5p-audio-player {
    padding: 12px;
    border-radius: 10px;
  }
  
  .h5p-audio-player audio {
    height: 35px;
  }
  
  /* Larger touch targets for mobile */
  .h5p-audio-player::-webkit-media-controls-play-button,
  .h5p-audio-player::-webkit-media-controls-mute-button,
  .h5p-audio-player::-webkit-media-controls-volume-slider {
    min-width: 44px;
    min-height: 44px;
  }
  
  .h5p-audio-player::-webkit-media-controls-timeline {
    height: 44px;
  }
}

@media screen and (max-width: 480px) {
  .h5p-audio-player {
    padding: 10px;
    border-radius: 8px;
  }
  
  .h5p-audio-player audio {
    height: 30px;
  }
  
  /* Adjust font sizes for smaller screens */
  .h5p-audio-player::-webkit-media-controls-current-time-display,
  .h5p-audio-player::-webkit-media-controls-time-remaining-display {
    font-size: 12px;
  }
}

/* Fallback for browsers that don't support custom media controls */
.h5p-audio-player audio:not([controls]) {
  display: none;
}

/* Loading state */
.h5p-audio-player.loading {
  opacity: 0.7;
  pointer-events: none;
}

/* Error state */
.h5p-audio-player.error {
  border: 2px solid #dc3545;
  background: #f8d7da;
}

/* Success state */
.h5p-audio-player.playing {
  background: #e9f5ff;
}

/* Focus states for accessibility */
.h5p-audio-player audio:focus {
  outline: 2px solid #007bff;
  outline-offset: 2px;
}</style>
